CREATE TABLE [tienda] (
  [id_tienda] integer UNIQUE PRIMARY KEY NOT NULL,
  [nombre_tienda] nvarchar(255),
  [localizacion] nvarchar(255)
)
GO

CREATE TABLE [articulo] (
  [id_articulo] integer UNIQUE PRIMARY KEY NOT NULL,
  [nombre_articulo] nvarchar(255),
  [id_departamento_fk] integer,
  [id_tienda_fk] integer,
  [id_factura_fk] integer
)
GO

CREATE TABLE [factura] (
  [id_factura] integer UNIQUE PRIMARY KEY NOT NULL,
  [fecha] date,
  [hora] timestamp,
  [monto] integer
)
GO

CREATE TABLE [departamento] (
  [id_departamento] integer UNIQUE PRIMARY KEY NOT NULL,
  [nombre_departamento] nvarchar(255)
)
GO

ALTER TABLE [articulo] ADD FOREIGN KEY ([id_departamento_fk]) REFERENCES [departamento] ([id_departamento])
GO

ALTER TABLE [articulo] ADD FOREIGN KEY ([id_tienda_fk]) REFERENCES [tienda] ([id_tienda])
GO

ALTER TABLE [articulo] ADD FOREIGN KEY ([id_factura_fk]) REFERENCES [factura] ([id_factura])
GO

